import java.util.Scanner;
public class Ifelse {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		
		if(n==10)
		{
			System.out.println("Number matched");
			
		}
		
		else
		{
			System.out.println("Number didn't matched");
		}
	}

}
